package application.model;

public class BarrierModel extends GameObjectModel{

	public BarrierModel(double x, double y, double w, double h) {
		// TODO Auto-generated constructor stub
		this.x = x;
		this.y = y;
		this.boundX = x;
		this.boundY = y;
		this.w = w;
		this.h = h;
		this.scale = 1;
	}

}
